import NavBar from "../components/NavBar"

import Calendar from 'react-calendar'

import 'react-calendar/dist/Calendar.css'

export default function Home() {
  return (
    <>
        <NavBar/>
        <Calendar
            style={{ width:'100%' }}
        />
        <style global jsx>{`
            react-calendar__tile {
                background: black;
            }
        `}</style>
    </>
  )
}
